      {
        user: "steve",
        message: "Stay hungry, and stay foolish",
        created_at: "2015-01-03 12:30:20",
      },
      {
        user: "tim",
        message: "education for real world",
        created_at: "2019-01-04 18:30:20",
      },
    ],
  };
  render() {
    return (
      <div id="wrapper">
        <header id="header">TWITTLER</header>
        <TwitForm />
      </div>
    );
  }
}

export default App;
